import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';
import CountyCard from '../card/CountyCard';

const AnyReactComponent = ({ children }) => <div>{children}</div>;

class Map extends Component {
    //props 不一定叫 props 也可以识别
    //state 一定得叫states
  static defaultProps = {
    center: {
      lat: 38.9072,
      lng: -77.0369,
    },
    zoom: 12 //from 1 (whole earth) to 20
  };

  state = {
      boundary:{},
      zoomLevel:12,
      points:{}, //fetched covid data
  };

  render() {
    return (
      // Important! Always set the container height explicitly
      // {} to call javascript
      <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{key:'AIzaSyCkRg8a0XvAbNSFM3xJILFbeVCx9q9dEBE'}}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >
            {this.renderPoints()} 
        </GoogleMapReact>
      </div>
    );
  }
  renderPoints() {
      return (
        <AnyReactComponent
        lat = {38.9072} //string and true dont need {}
        lng = {-77.0369}
        >
            <CountyCard />
        </AnyReactComponent>
      );
  }
}

export default Map;
